import React from 'react';
import contactList from '../../../utils/main/section-contact/contactList';

function Coordinates() {
  const contacts = contactList.map((item) => (
    item.index !== '5'
      ? (
        <li key={item.index} className="coordinates-item">
          <div className="single-contact-container">
            <img src={item.imageUrl} alt={item.imageAlt} className="contact-icon" />
            <p className="contact-text">{item.text}</p>
          </div>
        </li>
      )
      : (
        <li key={item.index} className="coordinates-item">
          <div className="single-contact-container">
            <img src={item.imageUrl} alt={item.imageAlt} className="contact-icon" />
            <p className="contact-text">{item.text}</p>
            <p className="contact-text2">{item.text2}</p>
          </div>
        </li>
      )
  ));

  return (
    <div className="coordinates-container">
      <ul className="coordinates-list">
        {contacts}
      </ul>
    </div>
  );
}

export default Coordinates;
